                <div class=""col-md-12"">
                    <p>
                        Anxiety can be a crippling condition that affects millions of people all over the world.
                        While there are many treatments available, some people still find themselves struggling to
                        manage their anxiety. If you are one of those people, don't give up. There is help
                        available, and you can overcome your anxiety
                    </p>
                    <p>
                        Many different methods can help you reduce your anxiety. Some people find relief through
                        therapy or medication, while others find comfort through self-care and relaxat");
            WriteLiteral(@"ion
                        techniques. It's essential to find what works best for you and to stick with it.
                    </p>
                    <p>
                        If you feel overwhelmed by your anxiety, start by taking small steps. Break down your goals
                        into smaller tasks that you can achieve quickly. Gradually increase the difficulty of the
                        tasks as you feel more comfortable. Remember to take breaks and celebrate your
                        accomplishments
                    </p>
                </div>
                <div class=""col-md-12"">
                    <div class=""info-wrapper"">
                        <h5 class=""info-question"">What is Anti Anxiety?</h5>
                        <p>Anxiety disorders are:</p>
                        <ul>
                            <li>
                                The most common mental illness in the United States.
                            </li>
                            ");
            WriteLiteral(@"<li>
                                Affects 40 million adults in the United States age 18 and older.
                            </li>
                            <li>
                                18.1% of the population every year.
                            </li>
                        </ul>
                        <p>
                            1 Anxiety disorders are highly treatable, yet only 36.9% of people with an anxiety
                            disorder receive treatment.2
                        </p>
                        <p>
                            Anti-anxiety refers to the term given to medication or other treatments used to relieve
                            symptoms of anxiety disorders. Anti-anxiety medications are also known as anxiolytics or
                            sedatives. Benzodiazepines and Buspirone are the most commonly prescribed anti-anxiety
                            medications.
                        </p>
                        <p>
      ");
            WriteLiteral(@"                      There are different types of anxiety disorders, each with its symptoms. The most common
                            types of anxiety disorders include:
                        </p>
                        <p>
                            Anti-anxiety medications are a type of medication used to treat anxiety disorders. They
                            may also be called anxiolytics, tranquilizers, or sedatives. Anti-anxiety medications
                            work by slowing down the activity of the central nervous system.
                        </p>
                    </div>
                    ");
