            WriteLiteral(@"
                    <div class=""info-wrapper"">
                        <h5 class=""info-question"">What Causes Anti Anxiety?</h5>
                        <p>
                            Different things cause anti-anxiety in other people. It can be caused by genetics, the
                            environment, or a combination. Some people have a chemical imbalance in their brain that
                            causes them to be anxious. Others may have experienced trauma or stress in their life
                            that has made them anxious. There is no single cause of anxiety. Apart from the things
                            mentioned above, other possible reasons include:
                        </p>
                        <ul>
                            <li>
                                Having a family member with an anxiety disorder
                            </li>
                            <li>
                                Having a history of physical or sexual abuse");
            WriteLiteral(@"
                            </li>
                            <li>
                                Taking certain medications
                            </li>
                            <li>
                                Using recreational drugs or alcohol
                            </li>
                            <li>
                                Experiencing significant life changes or stressful events
                            </li>
                            <li>
                                Having another mental health condition, such as depression
                            </li>
                        </ul>
                        <p>
                            If you are experiencing anxiety, you must speak to a doctor or mental health
                            professional. They will be able to help you understand what is causing your stress and
                            develop a treatment plan.
                        </p>
                    </div>
    ");
            WriteLiteral(@"                <div class=""info-wrapper"">
                        <h5 class=""info-question"">How do Anti Anxiety Treatments Work?</h5>
                        <p>
                            Anti-anxiety treatments work by reducing the number of stress hormones in the body, which
                            can help improve mood and reduce anxiety symptoms. Some common anti-anxiety treatments
